// SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.8.2 <0.9.0;

// Uncomment this line to use console.log
// import "hardhat/console.sol";

contract PetInc {
    // Constants
    uint256 internal constant INITIAL_STARS = 100;

    // State Variables
    bool internal locked;
    address public owner;

    address[] internal customerAddresses;
    string[] internal rewardNames;

    mapping(address => uint256) internal petStars;
    mapping(string => Reward) internal rewards;

    struct Reward {
        string name;
        uint256 cost;
        uint256 prize;
        uint256 quantity;
    }

    // Events
    event AccountCreated(address indexed account);
    event StarsEarned(address indexed account, uint256 starsEarned);
    event StarsRedeemed(
        address indexed account,
        uint256 starsSpent,
        string rewardName
    );

    constructor() payable {
        owner = msg.sender;
        locked = false;
    }

    receive() external payable {}

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can call this");
        _;
    }

    modifier onlyCustomer() {
        require(msg.sender != owner, "The Owner cannot call this");
        require(
            customerExist(msg.sender),
            "Only customers in our database can call this"
        );
        _;
    }

    modifier newCustomer() {
        require(msg.sender != owner, "The Owner cannot call this");
        require(
            !customerExist(msg.sender),
            "Only customers in our database can call this"
        );
        _;
    }

    modifier reEntrancyGuard() {
        require(!locked, "No re-entrancy");
        locked = true;
        _;
        locked = false;
    }

    function customerExist(address customer) internal view returns (bool) {
        for (uint i = 0; i < customerAddresses.length; i++) {
            if (customerAddresses[i] == customer) {
                return true;
            }
        }
        return false;
    }

    function rewardExist(
        string memory rewardName
    ) internal view returns (bool) {
        for (uint i = 0; i < rewardNames.length; i++) {
            if (stringsEqual(rewardNames[i], rewardName)) {
                return true;
            }
        }
        return false;
    }

    function stringsEqual(
        string memory stringA,
        string memory stringB
    ) internal pure returns (bool) {
        return
            keccak256(abi.encodePacked(stringA)) ==
            keccak256(abi.encodePacked(stringB));
    }

    function createAccount() public newCustomer {
        customerAddresses.push(msg.sender);
        petStars[msg.sender] = INITIAL_STARS;
    }

    function getStarsBalance() public view onlyCustomer returns (uint256) {
        return petStars[msg.sender];
    }

    function earnStars(uint256 stars) public onlyCustomer {
        require(stars > 0, "Stars earned must be greater than 0");
        petStars[msg.sender] += stars;
        emit StarsEarned(msg.sender, stars);
    }

    function redeemStars(
        string memory rewardName
    ) public onlyCustomer reEntrancyGuard {
        require(rewardExist(rewardName), "This reward does not exist");
        Reward storage reward = rewards[rewardName];

        require(reward.quantity > 0, "Invalid quantity");

        require(
            petStars[msg.sender] >= reward.cost,
            "You have insufficient stars for this reward"
        );

        petStars[msg.sender] -= reward.cost;
        reward.quantity -= 1;

        (bool success, ) = payable(msg.sender).call{value: reward.prize}("");
        require(success, "Redemption failed");
        emit StarsRedeemed(msg.sender, reward.cost, reward.name);
    }

    function addReward(
        string memory rewardName,
        uint256 rewardCost,
        uint256 rewardPrize,
        uint256 rewardQuantity
    ) public payable onlyOwner {
        require(rewardCost > 0, "Reward cost must be greater than 0");
        require(rewardQuantity > 0, "Reward quantity must be greater than 0");
        require(rewardPrize > 0, "Reward prize must be greater than 0");
        require(!rewardExist(rewardName), "This reward name already exist");

        rewards[rewardName] = Reward(
            rewardName,
            rewardCost,
            rewardPrize,
            rewardQuantity
        );
        rewardNames.push(rewardName);
    }

    function topUp() external payable onlyOwner {}
}

